package InterviewJava_Pattern;

public class Pattern1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//Display like 00 01 02 03 04 05 06 07 08 09 10 11 12 13
		
		for(int i=0;i<=9;i++){
			for(int j=0;j<=9;j++){
				System.out.print(i+""+j + " ");
			}
			System.out.println();
		}
		
		}

}
